                saveAs(blob, 'data_' + d3.time.format("%Y%m%d%H%M%S")(new Date()) + '.csv');
            }
        }
        function toggleChtEdit(cht = 'chart_2') {
            var d = document.getElementById(cht)
            var status = contains('#' + cht + ' text', 'edit.')[0].editEnable
            contains('#' + cht + ' text', 'edit.')[0].editEnable = !status
            Plotly.react(cht, d.data, d.layout, { editable: !status })
        }
        function togglAggAxis(cht = 'chart_2') {
            var status = contains('#' + cht + ' text', 'aggRL')[0].aggY
            contains('#' + cht + ' text', 'aggRL')[0].aggY = !status
            var data = document.getElementById(cht).data
            data.forEach(d => {
                if (d.name == "aggregate") d.yaxis = ((!d.yaxis) ? 'y2' : ((d.yaxis == 'y1') ? 'y2' : 'y1'))
            })
            Plotly.update(cht, data, document.getElementById(cht).layout)
        }; $("text:contains('edit...')")[0].addEventListener("click", function () { toggleChtEdit(); }); $("text:contains('aggRL')")[0].addEventListener("click", function () { togglAggAxis() }); function contains(selector, text) {
            var elements = document.querySelectorAll(selector);
            return [].filter.call(elements, function (element) {
                return RegExp(text).test(element.textContent);
            });
        } </script>
</body>
